export const name = "Amani Maina-Kilaas";

"#A31F34"

export const introduction = <div>
  <p>I am an incoming PhD student at <a href="https://bcs.mit.edu/about-bcs">MIT Brain & Cognitive Sciences</a>, where I will research cognition by studying human and artificial intelligence in tandem. I am excited about using artificial intelligence as a scientific tool to study how the mind works, and using what we know about the mind to develop more cognitively-realistic models. My work will be supported by the <a href="https://science.mit.edu/resource/dean-of-sciences-graduate-student-fellowship/">School of Science Dean's Fellowship</a>.</p>
  <p>I earned my Bachelor's with high distinction and departmental honors in Computer Science and Mathematics from <a href="https://www.hmc.edu/about/">Harvey Mudd College</a>, where I worked with <a href="https://www.linkedin.com/in/georgemontanez/">George Monta&ntilde;ez</a> in the <a href="https://www.cs.hmc.edu/~montanez/amistad.html">AMISTAD lab</a>. My work was supported by the <a href="https://www.hmc.edu/about/2022/08/12/harvey-mudd-college-2022-astronaut-scholars/">Astronaut Scholarship</a> and earned the <a href="https://cra.org/2022-outstanding-undergraduate-researcher-award-recipients/">CRA Outstanding Undergraduate Researcher Award</a>.</p>
</div>;

// icons from fontawesome 6.1.1 (free), or academicons (https://jpswalsh.github.io/academicons/)
export const icons = [
  {
    className: "ai ai-cv",
    link: process.env.PUBLIC_URL + '/maina-kilaas_cv.pdf'
  },
  {
    className: "ai ai-semantic-scholar",
    link: "https://www.semanticscholar.org/author/Amani-Rune-Maina-Kilaas/2051872161"
  },
  {
    className: "fa-brands fa-google",
    link: "https://scholar.google.com/citations?user=46I8yggAAAAJ"
  },
  {
    className: "fab fa-linkedin-in",
    link: "https://www.linkedin.com/in/amanirmk/"
  },
  {
    className: "fa-brands fa-twitter",
    link: "https://twitter.com/amanirmk"
  },
  {
    className: "fas fa-paper-plane",
    link: "mailto:amanirmk@mit.edu"
  }
];
